import React, { Component } from 'react';

class List extends Component {

    render() {
        // dynamically going through an array passed in through props,
        // for every item in that array, put it inside of <li> tags and
        // return it into this itemList variable
        const itemList = this.props.items.map(
            (item) => <li>{item}</li>
        );

        return(
            <div>
                <h3>{this.props.title}</h3>
                <ul>
                    {itemList}
                </ul>
            </div>
        );
    }
}

export default List;
